from flask import Flask, render_template, make_response
from flask_socketio import SocketIO, emit
import time
import random
import threading
from flask_cors import CORS
from pymysql import connect, util


app = Flask(__name__)
app.config['SECRET_KEY'] = 'topsecret'
CORS(app)
socketio = SocketIO(app)


db_info = dict(host='localhost', port=3306, user='root', 
    password='root', database='northwind')

conn = connect(**db_info)


@app.route('/category/<cat_id>/picture')
def category_picture(cat_id):
    sql='select picture from categories where category_id=%s'
    with conn.cursor() as cursor:
        cursor.execute(sql % (cat_id,))
        data = cursor.fetchone()
        resp = make_response(data[0])
        resp.headers['Content-Type'] = 'image/jpeg'
        return resp

@app.route('/base64-pic')
def send_base64_picture():
    data= 'data:image/jpeg;base64,'
    resp = make_response(data)
    resp.headers['Content-Type'] = 'image/jpeg'
    return resp
    
@app.route('/')
def index():
    return render_template('index.html')

@app.route('/picture/<n>')
def picture(n):
    try: n=int(n)
    except: n = 404

    if n not in (1,2,3,4): n=404

    with open('images/{}.jpg'.format(n), 'rb') as file:
        data = file.read()
        status = 404 if n==404 else 200
        resp = make_response(data, status)
        resp.headers['Content-Type'] = 'image/jpeg'
        return resp


@socketio.on('connect', namespace="/test")
def on_connection():
    print('some client connected')
    emit('msg', 'Welcome to Messages App.') 

@socketio.on('disconnect', namespace="/test")
def on_disconnection():
    print('some client disconnected')

@socketio.on('msg', namespace="/test")
def on_message(data):
    print(data)
    emit('msg', data.upper()) #, broadcast=True)
    
def start_threads():
    while True:
        time.sleep(random.randint(1,5))
        threading.Thread(target=send_numbers).start()

def send_numbers():
    socketio.emit('msg', random.randint(1, 10), namespace='/test')

if __name__ == "__main__":
    # app.run(host='localhost', port=5000)
    threading.Thread(target=start_threads).start()
    socketio.run(app, host='localhost', port=5000)